import clsx from "clsx";
import {
  LayoutDashboard,
  Users,
  Package,
  ShoppingCart,
  Settings,
} from "lucide-react";

const SidebarAdmin = ({ isSidebarOpen }) => {
  const Fiturs = [
    { href: "/DashboardAdmin", icon: LayoutDashboard, text: "Dashboard" },
    { href: "users", icon: Users, text: "Users" },
    { href: "#", icon: Package, text: "Stok" },
    { href: "order", icon: ShoppingCart, text: "Order" },
  ];

  return (
    <aside
      className={clsx(
        "fixed top-0 left-0 z-40 w-64 h-screen bg-white dark:bg-gray-800 border-r border-gray-200",
        isSidebarOpen ? "translate-x-0" : "-translate-x-full"
      )}
    >
      <div className="px-4 py-4">
        <h2 className="text-lg font-bold">Admin Menu</h2>
        <ul>
          {Fiturs.map((item, index) => (
            <li key={index}>
              <a
                href={item.href}
                className="block px-4 py-2 text-gray-600 dark:text-gray-400 hover:bg-gray-100 dark:hover:bg-gray-700"
              >
                <item.icon className="inline w-5 h-5 mr-2" />
                {item.text}
              </a>
            </li>
          ))}
        </ul>
      </div>
    </aside>
  );
};

export default SidebarAdmin;
